def count_bdd_nodes(bdd_root):
    """
    Counts the number of unique nodes in a BDD.

    Parameters:
    bdd_root (pyeda.boolalg.bdd.BDD): The root node of the BDD.

    Returns:
    int: The total number of unique nodes in the BDD.
    """
    visited = set()
    stack = [bdd_root]

    while stack:
        node = stack.pop()
        if node not in visited:
            visited.add(node)
            # If the node is not a terminal node, add its children to the stack
            if not node.is_one() and not node.is_zero():
                stack.append(node.high)
                stack.append(node.low)

    return len(visited)





